Accounts_CustomFields_Description:
Format JSON mora biti veljaven, kjer so ključi imena polj, ki vsebujejo slovar posameznih nastavitev. Primer:<br/><code>{
 "role": {
  "type": "select",
  "defaultValue": "student",
  "options": ["teacher", "student"],
  "required": true,
  "modifyRecordField": {
   "array": true,
   "field": "roles"
  }
 },
 "twitter": {
  "type": "text",
  "required": true,
  "minLength": 2,
  "maxLength": 10
 }
}</code>

Custom_Translations_Description:
Naj bo veljaven JSON, kjer so ključi jeziki, ki vsebujejo slovar ključa in prevodov. Primer: <br/><code>{
 "en": {
  "Channels": "Rooms"
 },
 "pt": {
  "Channels": "Salas"
 }
}</code>
